const testCases = require("./reverse-vowels-string.json");

function reverse_vowels_string(s) {
  const vowels = ["a", "e", "i", "o", "u", "A", "E", "I", "O", "U"];
  let replacedStr = s.split("");
  let left = 0;
  let right = replacedStr.length - 1;

  while (left < right) {
    if (
      vowels.includes(replacedStr[left]) &&
      vowels.includes(replacedStr[right])
    ) {
      // swap
      replacedStr = swap(replacedStr, left, right);
      left++;
      right--;
    } else if (vowels.includes(s[left]) && !vowels.includes(s[right])) {
      right--;
    } else if (!vowels.includes(s[left]) && vowels.includes(s[right])) {
      left++;
    } else {
      left++;
      right--;
    }
  }

  return replacedStr.join("");
}

function swap(arr, idx1, idx2) {
  const tmp = arr[idx1];
  arr[idx1] = arr[idx2];
  arr[idx2] = tmp;
  return arr;
}

